    true,nt"url": null,nt"notes": "The Program for International Student Assessment,
    2006 (PISA:06), is a study that is part of the Program for International Student
    Assessment (PISA) program. PISA:06 (http://nces.ed.gov/surveys/pisa/) is a cross-sectional
    study that measures the yield of education systems, or what skills and competencies
    students have acquired and can apply in reading, mathematics, and science to real-world
    contexts by age 15. For PISA:06, science literacy was the subject area assessed
    in-depth. The study was conducted using questionnaires and direct assessments of
    15-year-old students. 15-year-old students in April to May of 2006 were sampled.
    The studyufffds response rate was 91 percent. Key statistics produced from PISA:06
    are 15-year-olds' capabilities in reading, mathematics, and science literacy.",nt"owner_org":
